import { Card } from "react-bootstrap";

function FeedBackThankYou() {
    return ( 
        <>
        <div className="d-flex justify-content-center pt-5 ">
          <Card
            style={{
              width: "350px",
              height: "325px",
              backgroundColor: "hsl(213, 19%, 18%)",
            }}
            className="feedback"
          >
            <Card.Body>
              <div className="d-flex justify-content-center pt-3">
                  <img alt="star" src="illustration-thank-you.svg"   />
              </div>
              <div> 
                <p className="card-text text-center pt-3"> You selected 4 out of 5</p>
              </div>
              <Card.Title 
                className="pt-4 d-flex justify-content-center"
                style={{ color: "hsl(0, 0%, 100%)", fontFamily: "overpass"}}
              >
                Thank you!
              </Card.Title>
              <Card.Text
               className="card-text d-flex- justify-content-center text-center"
               style={{fontSize:"15px"}}
              >
                We appreciate  you taking the time to give a rating .If you ever need more support ,don't hesitate to get in touch!
              </Card.Text>
            </Card.Body>
          </Card>
        </div>
      </>
     );
}

export default FeedBackThankYou;
